 MediumEditor.extensions.button.extend({
  currentColor: peVariables['pe_color_green'],
  name: 'colorPicker',
  action: 'applyForeColor',
  aria: 'color picker',
  tagname: ['p', 'h3', 'h4'],
  contentDefault: '<div class="colorpicker-color"><div></div></div>',
  handleDocumentClickEventListener: null,
  handleButtonClickEventListener: null,

  init(): void {
    MediumEditor.extensions.button.prototype.init.call(this);

    this.handleDocumentClickEventListener = this.handleDocumentClick.bind(this);
    document.addEventListener('mouseup', this.handleDocumentClickEventListener);

    this.handleButtonClickEventListener = this.handleButtonClick.bind(this);
    this.button.addEventListener('click', this.handleButtonClickEventListener);

    this.setButtonColor(this.currentColor);
  },

  getButton(): void {
    return this.button;
  },

  handleClick(e: Event): void {
    e.preventDefault();
    e.stopPropagation();

    const self: any = this.base;
    self.saveSelection();

    // If no text selected, stop here.
    if ( self.selectionState && (self.selectionState.end - self.selectionState.start === 0) ) {
      return;
    }
    this.colorpickerInit();
  },

  handleButtonClick(e: Event): void {
    const className: string = 'open';
    if (this.button.parentElement.classList.contains(className)) {
      this.button.parentElement.classList.remove(className);
    } else {
      this.button.parentElement.classList.add(className);
    }
    e.stopPropagation();
  },

  setButtonColor(color: string): void {
    this.button.querySelector('div.colorpicker-color').style.backgroundColor = color;
  },

  handleDocumentClick(e: Event): void {
    const that: any = this;

    if (this.base.isActive) {
      const selection: Selection = window.getSelection();
      if (selection.anchorNode) {
        const node: HTMLElement = selection.anchorNode.parentElement;

        if (this.base.origElements.contains(node)) {
          this.currentColor = window.getComputedStyle(node, null).getPropertyValue('color');
          this.setButtonColor(this.currentColor);
        }
      }
    }

    setTimeout(function() {
      if (!that.button.parentElement.contains(e.target)) {
        that.button.parentElement.classList.remove('open');
      }
    }, 0);
  },

  createPickerContainer(): any {
    const container: HTMLElement = document.createElement('div');
    container.classList.add('dropdown-menu');
    container.classList.add('colorpicker-element');
    container.classList.add('pull-right');
    return container;
  },

  getColorPickerContainer(): any {
    const parent: HTMLElement = this.button.parentElement;
    const container: Element = parent.querySelector('div.colorpicker-element');
    if (!container) {
      parent.appendChild(this.createPickerContainer());
    }
    return parent.querySelector('div.colorpicker-element');
  },

  colorpickerInit(): void {
    const self: any = this.base;
    $(this.getColorPickerContainer()).colorpicker({
      color: this.currentColor,
      container: true,
      inline: true,
      slidersHorz: this.screenAdjust()
    })
      .on('changeColor', (e: any) => {
        const color: string = e.color.toString();
        self.restoreSelection();
        self.options.ownerDocument.execCommand('styleWithCSS', false, true);
        self.options.ownerDocument.execCommand('foreColor', false, color);
        this.setButtonColor(color);
      });
  },

  screenAdjust(): any {
    const currentWidth: number = $(this.getColorPickerContainer()).width();

    const sliders: any = {
      saturation: {
        maxLeft: currentWidth,
        maxTop: 200,
        callLeft: 'setSaturation',
        callTop: 'setBrightness'
      },
      hue: {
        maxLeft: currentWidth,
        maxTop: 0,
        callLeft: 'setHue',
        callTop: false
      },
      alpha: {
        maxLeft: currentWidth,
        maxTop: 0,
        callLeft: 'setAlpha',
        callTop: false
      }
    };

    return sliders;
  },

  destroy(): void {
    if (this.handleDocumentClickEventListener) {
      document.removeEventListener('mouseup', this.handleDocumentClickEventListener);
    }

    if (this.handleButtonClickEventListener) {
      this.button.removeEventListener('click', this.handleButtonClickEventListener);
    }
  }
})

 MediumEditor.extensions.button.extend({

  dropdownIcon: '<svg class="icon icon-16 icon-arrow-down"><use xlink:href="#icon-arrow-down-small-16"></use></svg>',

  createIconPlaceholder(): void {
    this.iconPlaceholder = document.createElement('span');
    this.iconPlaceholder.classList.add('medium-editor-dropdown-icon');
  },

  getButton(): any {
    this.button = document.createElement('button');
    this.button.classList.add('medium-editor-dropdown');
    this.button.classList.add(`medium-editor-dropdown-${this.name}`);

    if (!this.iconPlaceholder) {
      this.createIconPlaceholder();
    }

    this.childrenUl = document.createElement('ul');
    this.childrenUl.classList.add('medium-editor-dropdown-list');
    this.childrenUl.classList.add('dropdown-menu');
    if (this.horizontal) {
      this.childrenUl.classList.add('dropdown-horizontal');
    }

    for (const child of this.children) {
      const li: Element = document.createElement('li');
      const childButton: any = this.getChildButton(child);
      childButton.classList.add('medium-editor-dropdown-button');
      if (MediumEditor.util.isElement(childButton)) {
        li.appendChild(childButton);
      } else {
        li.innerHTML = childButton;
      }
      this.childrenUl.appendChild(li);
    }

    this.button.appendChild(this.iconPlaceholder);
    this.button.appendChild(this.childrenUl);
    this.button.insertAdjacentHTML('beforeend', this.dropdownIcon);
    this.setCurrentButton(this.getChildButton(this.children[0]));

    this.on(this.button, 'click', this.handleButtonClick.bind(this));
    this.on(document, 'mouseup', this.handleDocumentClick.bind(this));

    return this.button;
  },

  handleButtonClick(e: any): void {
    if (this.button.classList.contains('open')) {
      this.button.classList.remove('open');
    } else {
      this.button.classList.add('open');
    }
    e.stopPropagation();
  },

  handleDocumentClick(e: any): any {
    let _this: any = this;
    setTimeout(function(): void {
      if (!_this.button.contains(e.target) || _this.childrenUl.contains(e.target)
      ) {
        _this.button.classList.remove('open');
      }
    }, 0);
  },

  getChildButtonExtension(child: any): any {
    let buttonName: string, buttonOpts: Element;
    if (typeof child === 'string') {
      buttonName = 'button';
      buttonOpts = null;
    } else {
      buttonName = child.name;
      buttonOpts = child;
    }
    return this.base.addBuiltInExtension(buttonName, buttonOpts);
  },

  getChildButton(child: any): any {
    const extension: any = this.getChildButtonExtension(child);
    if (extension && typeof extension.getButton === 'function') {
      return extension.getButton(this.base);
    }
    return null;
  },

  isAlreadyApplied(node: any): any {
    for (const child of this.children) {
      const extension: any = this.getChildButtonExtension(child);
      if (extension && extension.isAlreadyApplied(node)) {
        this.setCurrentButton(extension.getButton());
        return true;
      }
    }

    this.setCurrentButton(this.getChildButtonExtension(this.children[0]).getButton());
    return false;
  },

  setCurrentButton(button: any): any {
    if (!this.iconPlaceholder) {
      this.createIconPlaceholder();
    }
    this.iconPlaceholder.innerHTML = button.innerHTML;
  }

})

