 MediumEditor.extensions.button.extend({
    name: 'linkToButton',
    tagNames: ['button'],
    contentDefault: '<svg class="icon icon-16"><use xlink:href="#icon-ep-button-16"></use></svg>',
    aria: 'link to button',
    action: 'linkToButton',
    customClass: 'pe-btn-link',
    currentColorpicker: {},
    defaultOptions: [],
    currentLink: null,
    containerOpenClassName: 'open',
    specialBtnActiveClass: 'medium-editor-button-active',
    handleBtnContainerClickEventListener: null,
    handleDocumentClickEventListener: null,

    init(): void {
      MediumEditor.extensions.button.prototype.init.call(this);

      this.handleDocumentClickEventListener = this.handleDocumentClick.bind(this);
      document.addEventListener('mouseup', this.handleDocumentClickEventListener);

      this.setDefaultOptions();
    },

    setDefaultOptions (): void {
      for ( const item of this.btnConfig ) {
        switch (item.type) {
          case 'colorpicker':
            this.defaultOptions[item.styleName] = item.styleValue;
            break;
          case 'switcher':
            if(item.switcherDefaultPosition) {
              this.defaultOptions[`${item.styleName}-switcher`] = item.styleValue;
            }
            break;
          default:
            break;
        };
      }
    },

    handleClick(event: Event): void {
      event.preventDefault();
      event.stopPropagation();

      if( !this.getBtnContainer() ) {
        this.initBtnContainer();
      }

      if( !this.isContainerOpen() ) {
        if ( !this.isActive() ) {
          this.createBtnLink();
          this.setBtnSettings( this.currentLink, this.defaultOptions );
        } else {
          this.currentLink = this.getSelectedButton();
          this.setBtnContainerSettings( this.getContainerSettings( this.getBtnSettings(this.currentLink) ) );
        }
      }

      this.toggleBtnDetailsContainer();
    },

    createBtnLink():void {
      const document = this.base.options.ownerDocument;
      const buttonText: string = document.getSelection().toString();
      document.execCommand('insertHTML', false, '<button>'+ buttonText +'</button>');
      const createdBtnLink = (document.getSelection().focusNode.parentNode as HTMLElement);
      createdBtnLink.classList.add(this.customClass);
      this.currentLink = createdBtnLink;
    },

    removeBtnLink(): void {
      this.currentLink.outerHTML = this.currentLink.innerHTML;
    },

    getCurrentLink(): HTMLElement | null {
      return this.currentLink || null;
    },

    getSelectedButton(): HTMLElement | null {
      let selectedElement = ( window.getSelection().getRangeAt(0).startContainer.parentNode as HTMLElement );
      selectedElement = (selectedElement.tagName === 'A')? (selectedElement.parentNode as HTMLElement) : selectedElement;

      if ( selectedElement.classList.contains(this.customClass) ) {
        return selectedElement;
      } else  {
        return null
      }
    },

    setBtnSettings (element: HTMLElement , settings: any): void {
      for (let i in settings) {
        element.style[i] = settings[i];
        element.setAttribute('data-'+ i, settings[i]);
        if ( /-switcher$/.test(i) ){
          element.style[i.replace('-switcher', '')] = settings[i];
        }
      }
    },

    getBtnSettings( el: HTMLElement ): any {
      let data: any = [];
      [].forEach.call(el.attributes, function(attr: Attr) {
        if (/^data-/.test(attr.name)) {
          data[ attr.name.substr(5) ] = attr.value;
        }
      });
      return data;
    },

    handleDocumentClick(e: Event): void {
      const that: any = this;
      setTimeout(function () {
        if (!that.button.parentElement.contains(e.target)) {
          that.button.parentElement.classList.remove('open');
        }
      }, 0);

      if (!$(e.target).parents('.btn-colorpicker').length) {
        $(this.getBtnContainer()).find('.open').removeClass('open');
        this.destroyColorpicker();
      }
    },

    destroyColorpicker(): void {
      $(this.getBtnContainer()).find('.color-picker-container').colorpicker('destroy');
    },

    handleBtnButtonClick(ed: any, e: Event): void {
      e.stopPropagation();
    },

    handleBtnSwitcherClick(editor: any, event: Event ): void {
      const switcher: any = $(event.target);
      const styleName: string = switcher.data('style-name');
      const styleValue: string = switcher.data('style-value');
      const currentLink: HTMLElement = editor.getCurrentLink();
      const colorpickerBtn: any = $(editor.getBtnContainer()).find(`.btn-colorpicker[data-style-name="${styleName}"]`).parents('.row');

      if (switcher.is(':checked')) {
        currentLink.style[styleName] = styleValue;
        currentLink.setAttribute(`data-${styleName}-switcher`, styleValue);
        colorpickerBtn.addClass('disabled');
      } else {
        currentLink.style[styleName] = currentLink.getAttribute('data-'+ styleName);
        currentLink.setAttribute(`data-${styleName}-switcher`, 'false');
        colorpickerBtn.removeClass('disabled');
      }

      this.triggerEditorEditableInputEvent(editor);
    },

    handleBtnColorClick(editor: any, event: Event): void {
      editor.destroyColorpicker();

      const colorButton: any = $(event.target);
      const colorContainer: any = colorButton.parent();
      const colorPickerContainer: any = colorContainer.find('.color-picker-container');
      const styleName: string = colorContainer.data('style-name');

      const currentLink: HTMLElement = editor.getCurrentLink();
      const styleValue: string = currentLink.getAttribute(`data-${styleName}`);

      colorPickerContainer.colorpicker({
          color: styleValue,
          inline: true,
          container: true
      })
      .on('changeColor', (event: any) => {
        const color: string = event.color.toString();
        let currentLink = editor.getCurrentLink();
        currentLink.style[styleName] = color;
        currentLink.setAttribute(`data-${styleName}`, color);
        colorButton.css('background-color', color);

        this.triggerEditorEditableInputEvent(editor);
      });

      if (colorContainer.hasClass('open')) {
        colorContainer.removeClass('open');
      } else {
        $(editor.getBtnContainer()).find('.open').removeClass('open');
        colorContainer.addClass('open');
      }
    },

    handleBtnRemoveClick(editor: any, event: Event): void {
      editor.removeBtnLink();
      editor.button.classList.remove(editor.specialBtnActiveClass);
      editor.toggleBtnDetailsContainer();

      this.triggerEditorEditableInputEvent(editor);
    },

    triggerEditorEditableInputEvent(editor: any) {
      let editorElement = editor.base.elements[0];
      editor.base.trigger('editableInput', { target: editorElement, currentTarget: editorElement }, editorElement);
    },

    createBtnContainer(): void {
      const container: HTMLElement = document.createElement('div');
      container.className = 'btn-container dropdown-menu';
      this.button.parentElement.appendChild( container );
    },

    getBtnContainer(): HTMLElement {
      return this.button.parentElement.querySelector('div.btn-container');
    },

    initBtnContainer(): void {
      this.createBtnContainer();
      this.setBtnContainerSettings(this.btnConfig);

      const btnContainer = this.getBtnContainer();

      this.handleBtnContainerClickEventListener = this.handleBtnContainerClick.bind(this);
      btnContainer.addEventListener('click', this.handleBtnContainerClickEventListener);
    },

    handleBtnContainerClick(event: Event): void {
      let clickedEl = (event.target as HTMLElement);

      if (clickedEl.classList.contains('btn-btngroup')) {
        this.handleBtnButtonClick(this, event);
      } else if (clickedEl.classList.contains('btn-switcher')) {
        this.handleBtnSwitcherClick(this, event);
      } else if (clickedEl.classList.contains('color')) {
        this.handleBtnColorClick(this, event);
      } else if (clickedEl.classList.contains('btn-remove')) {
        this.handleBtnRemoveClick(this, event);
      }
    },

    setBtnContainerSettings(settings: any): void {
      const btnContainer = this.getBtnContainer();
      btnContainer.innerHTML = '';

      let i: number = 0;
      for ( const item of settings ) {
        let control: string;
        switch (item.type) {
          case 'colorpicker':
            control = `
              <div class="btn-colorpicker" data-style-name="${item.styleName}" data-style-value="${item.styleValue}">
                <div class="color" style="background-color: ${item.styleValue}"></div>
                <div class="dropdown-menu color-picker-container"></div>
              </div>`;
            break;
          case 'switcher':
            const switchValue: string = item.switcherDefaultPosition ? item.styleValue : item.switcherDefaultPosition;
            const isChecked: string = item.switcherDefaultPosition ? 'checked' : '';
            control = `
              <input class="form-control-toggle input-xs btn-switcher" type="checkbox"
                id="editor_switcher_${i}"
                data-style-name="${item.styleName}"
                data-style-value="${item.styleValue}"
                ${isChecked}
                >
              <label for="editor_switcher_${i}"></label>`;
            break;
          default:
            break;
        };

        let row = document.createElement("div");
        row.className = 'row';
        row.innerHTML = `
            <div class="col-xs-8 btn-control-title" title="${item.title}">${item.title}</div>
            <div class="text-right col-xs-4">${control}</div>
        `
        btnContainer.appendChild(row);
        i++;
      }

      btnContainer.appendChild( this.createRemoveButtonBtn() );
    },

    getContainerSettings(settings: any) {

      let currentContainerSettings = this.btnConfig.map( (item: any) => Object.assign({}, item) );
      for (let j in settings) {
        if (settings.hasOwnProperty(j)) {
          let name = j;
          if (/-switcher$/.test(j)) {
            let name = j.replace('-switcher', '');
            currentContainerSettings.map((item: any) => {
              if(item.styleName === name && item.type === 'switcher') {
                item.switcherDefaultPosition = (settings[j] == 'false')? false : settings[j];
              }
            });
          } else {
            currentContainerSettings.map((item: any) => {
              if(item.styleName === j && item.type === 'colorpicker') {
                item.styleValue = settings[j];
              }
            });
          }

        }
      };
      return currentContainerSettings;
    },

    createRemoveButtonBtn(): HTMLElement {
      let row = document.createElement('div');
      row.className = 'row';
      row.innerHTML = `
        <div class="text-left">
          <button class="btn btn-default btn-danger btn-remove">Remove</button>
        </div>`;
       return row;
    },

    toggleBtnDetailsContainer(): void {
      const editorBtnBtnParent = this.button.parentElement;
      const btnContainer = this.getBtnContainer();
      const specialDropupClass = 'special-dropup';


      if (editorBtnBtnParent.classList.contains(this.containerOpenClassName)) {
        editorBtnBtnParent.classList.remove(this.containerOpenClassName);
        btnContainer.style.display = 'none';
        this.destroyColorpicker();
        $(editorBtnBtnParent).closest('li').removeClass(specialDropupClass);
      } else {
        this.button.parentElement.classList.add(this.containerOpenClassName);
        btnContainer.style.display = 'block';
        this.button.classList.add(this.specialBtnActiveClass);

        if ( btnContainer.clientHeight < this.button.getBoundingClientRect().top ) {
          $(editorBtnBtnParent).closest('li').addClass(specialDropupClass);
        }
      }
    },

    isContainerOpen(): void {
      return this.button.parentElement.classList.contains(this.containerOpenClassName);
    },

    destroy(): void {
      if (this.handleDocumentClickEventListener) {
        document.removeEventListener('mouseup', this.handleDocumentClickEventListener);
      }

      const btnContainer = this.getBtnContainer();
      if (this.handleBtnContainerClickEventListener) {
        btnContainer.removeEventListener('click', this.handleBtnContainerClickEventListener);
      }
    }
})

